import React from 'react';
import { connect } from 'react-redux';

const ImageMain = () => {
  console.log(url.url);
  return(
    <div>
        <img
          className="sample-img"
          src=""
          alt="analyze main"
        />
    </div>
  );
};

const mapStateToProps = state => {
  return {
    url: state.url
  };
};

export default connect(mapStateToProps)(ImageMain);
